}

componentDidMount(){
    axios.get('http://www.dell-lee.com/react/api/list.json')
    .then(res=>{
        // console.log(res.data.data)
this.setState({
    data:res.data.data
})
    })
}


render(){
    return (
        <List
     
      bordered
      dataSource={this.state.data}
